import React from 'react';
import logo from './logo.svg';
import './App.css';
import AppRouter from './appRouter/appRouter';
import { Container, Row, Col } from 'react-bootstrap';

function App() {
  return <Container>
    <Row>
      <Col md={{ span: 10, offset: 1 }}>
        <AppRouter className="offset-md-2 col-md-8" />
      </Col>
    </Row>
  </Container>
}

export default App;
